import { Routes, Route } from "react-router-dom"
import FetchNews from "./components/FetchNews"
import Item from "./Item";

export default function App() {
  return (
    <>

        <Routes>
          <Route path="/" element={<FetchNews />} />
          <Route path='/item/:id' element={<Item />}/>
        </Routes>

    </>
  )
}
